import{_ as e,o as a,c as l,b as i}from"./app.d2d47940.js";const f=JSON.parse('{"title":"直播的运行过程","description":"","frontmatter":{},"headers":[{"level":2,"title":"主流程","slug":"主流程","link":"#主流程","children":[{"level":3,"title":"1.采集","slug":"_1-采集","link":"#_1-采集","children":[]},{"level":3,"title":"2.编码","slug":"_2-编码","link":"#_2-编码","children":[]},{"level":3,"title":"3.上传","slug":"_3-上传","link":"#_3-上传","children":[]},{"level":3,"title":"4.下载","slug":"_4-下载","link":"#_4-下载","children":[]},{"level":3,"title":"5.播放","slug":"_5-播放","link":"#_5-播放","children":[]}]},{"level":2,"title":"直播的相关参数","slug":"直播的相关参数","link":"#直播的相关参数","children":[{"level":3,"title":"1.码率/比特率（byterate）","slug":"_1-码率-比特率-byterate","link":"#_1-码率-比特率-byterate","children":[]},{"level":3,"title":"2.帧率（FPS）","slug":"_2-帧率-fps","link":"#_2-帧率-fps","children":[]},{"level":3,"title":"3.丢包率","slug":"_3-丢包率","link":"#_3-丢包率","children":[]},{"level":3,"title":"4.分辨率","slug":"_4-分辨率","link":"#_4-分辨率","children":[]},{"level":3,"title":"5.上传速度","slug":"_5-上传速度","link":"#_5-上传速度","children":[]},{"level":3,"title":"6.下载速度","slug":"_6-下载速度","link":"#_6-下载速度","children":[]}]},{"level":2,"title":"解决直播卡顿","slug":"解决直播卡顿","link":"#解决直播卡顿","children":[]}],"relativePath":"knowledges/tech/other/media/直播的运行过程.md","lastUpdated":1678618356000}'),r={name:"knowledges/tech/other/media/直播的运行过程.md"},t=i('<h1 id="直播的运行过程" tabindex="-1">直播的运行过程 <a class="header-anchor" href="#直播的运行过程" aria-hidden="true">#</a></h1><h2 id="主流程" tabindex="-1">主流程 <a class="header-anchor" href="#主流程" aria-hidden="true">#</a></h2><p><img src="https://cdn.nlark.com/yuque/0/2021/jpeg/743297/1627349974007-3d6b376a-8264-4337-a6d4-1dfa71cabe42.jpeg#alt=img" alt=""></p><h3 id="_1-采集" tabindex="-1">1.采集 <a class="header-anchor" href="#_1-采集" aria-hidden="true">#</a></h3><p>采集画面</p><h3 id="_2-编码" tabindex="-1">2.编码 <a class="header-anchor" href="#_2-编码" aria-hidden="true">#</a></h3><p>视频编码</p><p><strong>编码格式</strong></p><ul><li></li></ul><p>h.264</p><ul><li></li></ul><p>h.265</p><ul><li></li></ul><p>vp8</p><ul><li></li></ul><p>vp9</p><p><img src="https://cdn.nlark.com/yuque/0/2021/png/743297/1627350187492-1892605e-0d7b-470c-8e96-9fc1e3fe8f8e.png#alt=img" alt=""></p><p><strong>封装格式</strong></p><ul><li></li></ul><p>mp4</p><ul><li></li></ul><p>avi</p><ul><li></li></ul><p>mkv</p><p><img src="https://cdn.nlark.com/yuque/0/2021/png/743297/1627350933765-8876262c-a4c4-43a8-a9cd-febf89f2ebb0.png#alt=img" alt=""></p><h3 id="_3-上传" tabindex="-1">3.上传 <a class="header-anchor" href="#_3-上传" aria-hidden="true">#</a></h3><p>上传视频，主播端上传视频到服务器</p><h3 id="_4-下载" tabindex="-1">4.下载 <a class="header-anchor" href="#_4-下载" aria-hidden="true">#</a></h3><p>下载视频，观看端从服务器中下载视频</p><h3 id="_5-播放" tabindex="-1">5.播放 <a class="header-anchor" href="#_5-播放" aria-hidden="true">#</a></h3><p>播放视频，观看端将下载好的主播端的视频进行解码，解码成播放器可识别的格式，使用播放视频。</p><h2 id="直播的相关参数" tabindex="-1">直播的相关参数 <a class="header-anchor" href="#直播的相关参数" aria-hidden="true">#</a></h2><h3 id="_1-码率-比特率-byterate" tabindex="-1">1.码率/比特率（byterate） <a class="header-anchor" href="#_1-码率-比特率-byterate" aria-hidden="true">#</a></h3><p>定义：数据传输时单位事件传送的数据量，单位kbps</p><p>摄像机采集的画面需要经过压缩之后再进行网络传输，压缩的比率越小，视频越清晰，视频码率越高。码率越高要求的设备配置也越高，一般设置码率为800~1500</p><h3 id="_2-帧率-fps" tabindex="-1">2.帧率（FPS） <a class="header-anchor" href="#_2-帧率-fps" aria-hidden="true">#</a></h3><p>定义：每秒中切换画面的次数，视频帧率越高，视频看起来越流畅。</p><h3 id="_3-丢包率" tabindex="-1">3.丢包率 <a class="header-anchor" href="#_3-丢包率" aria-hidden="true">#</a></h3><p>定义：用户数据传输过程中是以包（packet）的传输的，一个数据包包含一组数据，而在传输过程 中，被异常丢弃的数据包占所有发送的数据包的比率，就是丢包率</p><h3 id="_4-分辨率" tabindex="-1">4.分辨率 <a class="header-anchor" href="#_4-分辨率" aria-hidden="true">#</a></h3><p>定义：图像内像素点的数量。例如1920*1080分辨率的图片，约有200万像素点。</p><h3 id="_5-上传速度" tabindex="-1">5.上传速度 <a class="header-anchor" href="#_5-上传速度" aria-hidden="true">#</a></h3><p>主要与视频的码率大小和网络速度相关，码率越大，视频文件越大，上传时间越久。</p><h3 id="_6-下载速度" tabindex="-1">6.下载速度 <a class="header-anchor" href="#_6-下载速度" aria-hidden="true">#</a></h3><p>主要与视频的码率大小和网络速度、宽带带宽大小相关，码率越大，网络带宽小，视频文件越大，下载时间越久。</p><h2 id="解决直播卡顿" tabindex="-1">解决直播卡顿 <a class="header-anchor" href="#解决直播卡顿" aria-hidden="true">#</a></h2><p>1.连接更好的网络</p><p>2.降低视频清晰度</p>',48),h=[t];function d(n,s,p,c,_,u){return a(),l("div",null,h)}const g=e(r,[["render",d]]);export{f as __pageData,g as default};
